// SPDX-License-Identifier: GPL-3.0

pragma solidity 0.8.18;

/*
Etape 0, préparer toutes les addresses a dispo et les mettre dans les bons champs du contrat
https://docs.uniswap.org/contracts/v3/reference/deployments
routeur: 0xE592427A0AEce92De3Edee1F18E0157C05861564
Link token: 0x326C977E6efc84E512bB9C30f76E30c160eD06FB
usdc : 0x07865c6E87B9F70255377e024ace6630C1Eaa37F
Weth9: 0xB4FBF271143F4FBf7B91A5ded31805e42b2208d6
(je prends le link par simplicité: j'en ai, une pool existe, et on est sur de l'addresse, c'est chainlink qui le file)
*/

interface IERC20 {
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function approve(address spender, uint256 amount) external returns (bool);
    function transfer(address to, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
    function allowance(address owner, address spender) external view returns (uint256);
}

interface IWETH {
    function withdraw(uint256 amount) external;
}

interface ISwapRouter {
    struct ExactInputSingleParams {
        address tokenIn;
        address tokenOut;
        uint24 fee;
        address recipient;
        uint256 deadline;
        uint256 amountIn;
        uint256 amountOutMinimum;
        uint160 sqrtPriceLimitX96;
    }

    /// @notice Swaps `amountIn` of one token for as much as possible of another token
    /// @param params The parameters necessary for the swap, encoded as `ExactInputSingleParams` in calldata
    /// @return amountOut The amount of the received token
    function exactInputSingle(ExactInputSingleParams calldata params) external payable returns (uint256 amountOut);
}

contract MyDeFiProject {
    // ISwapRouter public immutable swapRouter;
    ISwapRouter public constant swapRouter = ISwapRouter(0xE592427A0AEce92De3Edee1F18E0157C05861564);


    address public constant WETH9 = 0xB4FBF271143F4FBf7B91A5ded31805e42b2208d6;
    address public constant USDC = 0x07865c6E87B9F70255377e024ace6630C1Eaa37F;


    // Pour cet exemple, on va prendre des frais de pool à 0.3%
    uint24 public constant poolFee = 3000;


    // constructor(ISwapRouter _swapRouter) {
    //     swapRouter = _swapRouter;
    // }

    function swapExactInputSingle(uint256 amountIn, address _token) external {

        // Transfert des tokens en question au smart contract ! Il faut penser à approve ce transfert avant l’utilisation de cette fonction 
        IERC20(_token).transferFrom(msg.sender, address(this), amountIn);

        // autoriser uniswap à utiliser nos tokens
        IERC20(_token).approve(address(swapRouter), amountIn);

        //Creation des paramètres pour l'appel du swap
        ISwapRouter.ExactInputSingleParams memory params =
            ISwapRouter.ExactInputSingleParams({
                tokenIn: _token,
                tokenOut: WETH9,
                fee: poolFee,
                recipient: msg.sender,
                deadline: block.timestamp,
                amountIn: amountIn,
                amountOutMinimum: 0,
                sqrtPriceLimitX96: 0
            });

        // effectuer le swap, ETH sera transférer directement au msg.sender
        swapRouter.exactInputSingle(params);
    }


    function convertWethToEth(uint256 amount) public {
        require(getWethBalance()>=amount, "you have no monney");
        IERC20(WETH9).approve(address(this), amount);
        IWETH(WETH9).withdraw(amount);
    }

    function sendEthTo(address _to, uint256 amount) public {
        require(address(this).balance>=amount, "you have no monney");
        (bool success, ) = _to.call{value: amount}("");
        require(success, "Transfer failed.");
    }

    function getWethBalance() public view returns(uint) {
        return IERC20(WETH9).balanceOf(address(this));
    }

    function swapExactInputEth(address _inputToken, uint256 amountIn) public {

        // Transfert des tokens en question au smart contract ! Il faut penser à approve ce transfert avant l’utilisation de cette fonction 
        IERC20(_inputToken).transferFrom(msg.sender, address(this), amountIn);

        // autoriser uniswap à utiliser nos tokens
        IERC20(_inputToken).approve(address(swapRouter), amountIn);

        //Creation des paramètres pour l'appel du swap
        ISwapRouter.ExactInputSingleParams memory params =
            ISwapRouter.ExactInputSingleParams({
                tokenIn: _inputToken,
                tokenOut: WETH9,
                fee: poolFee,
                recipient: address(this),
                deadline: block.timestamp,
                amountIn: amountIn,
                amountOutMinimum: 0,
                sqrtPriceLimitX96: 0
            });

        // effectuer le swap, WETH sera transféré au smart contract
        swapRouter.exactInputSingle(params);

    }

    // Fonction pour vérifier le solde du contrat
    function getContractEthBalance() public view returns (uint256) {
        return address(this).balance;
    }

    function swapUSDCtoETH(uint usdcAmount) external {

        // USDC TO WETH9
        swapExactInputEth(USDC, usdcAmount);

        // USDC TO ETH (on smart contract)
        convertWethToEth(getWethBalance());

        // ETH IN YOUR WALLET
        sendEthTo(msg.sender, getContractEthBalance());
    }

    receive() external payable {

    }

}

